import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    IconButton,
    Box,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
  } from "@mui/material";

function NavBar() {
    return(
        <AppBar>
            <Toolbar>
                <IconButton>
                    <h1>home icon</h1>
                </IconButton>
            </Toolbar>
        </AppBar>
    );
};
export default NavBar;
